import React, { useEffect, useState } from 'react';
import {
  Button,
  Window,
  WindowContent,
  WindowHeader,
  ScrollView
} from 'react95';


export default ({setShowTrash}) => {
  const [showKali, setShowKali] = useState(false);
  return (
    <>
      <Window style={{width: '500px'}} resizable className='window'>
        <WindowHeader style={{
          display: 'flex',
          justifyContent: 'space-between'
        }}>
          <span>Recycling Bin</span>
          <Button style={{marginTop: '2px'}} onClick={()=>{
            setShowTrash(false)}}>
            <b>x</b>
          </Button>
        </WindowHeader>
        <WindowContent>
          <ScrollView style={{
            backgroundColor: 'white',
            height: '300px',
            width: '100%',
          }}>
            <div style={{textAlign: 'center', width: 'max-content', margin: '20px', cursor: 'pointer'}}><img style={{width: '60px', marginBottom: '5px'}} src='/imgicon.svg'></img><br />Nude.jpg</div>
            <Window style={{width: '500px', display: (!showKali) ? 'none' : 'inherit'}} resizable className='window'>
              <WindowHeader style={{
                display: 'flex',
                justifyContent: 'space-between'
              }}>
                <span>Nude.jpg</span>
                <Button style={{marginTop: '2px'}} onClick={()=>{
                  setShowKali(true)}}>
                  <b>x</b>
                </Button>
              </WindowHeader>
              <WindowContent>KALIIIIIIIIIIII</WindowContent>
              </Window>
          </ScrollView>
        </WindowContent>
      </Window>

    </>
  );
}
